import Picture from "./Picture";
import { useContext } from "react";
import mainContext from "../context/mainContext";

function Comp6() {
  const { getImage } = useContext(mainContext);
  return (
    <div className="comp6">
      {getImage.map((x) => (
        <Picture object={x} />
      ))}
    </div>
  );
}

export default Comp6;
